<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <meta name="viewport" content="initial-scale=1, width=device-width" />

    <link rel="stylesheet" href="./global.css" />
    <link rel="stylesheet" href="./android-large-9.css" />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Montserrat:wght@400;500;600;700&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Roboto:wght@600&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Quicksand:wght@600&display=swap"
    />
  </head>
  <body>
    <div class="android-large-9">
      <div class="android-large-9-child"></div>
      <div class="android-large-9-item"></div>
      <div class="line-parent">
        <div class="frame-child28"></div>
        <div class="frame-child29"></div>
      </div>
      <div class="android-large-9-inner"></div>
      <section class="android-large-9-inner1">
        <div class="frame-parent21">
          <header class="frame-parent22">
            <div class="time-parent3">
              <div class="time6">9:41</div>
              <div class="chevron-left-container">
                <img
                  class="chevron-left-icon2"
                  alt=""
                  src="./public/chevronleft.svg"
                />
              </div>
            </div>
            <div class="cellular-connection-wrapper3">
              <div class="cellular-connection">
                <div class="cellular-connection-inner">
                  <div class="workout-schedule-parent">
                    <h2 class="workout-schedule">Workout Schedule</h2>
                    <div class="calendar-background-wrapper">
                      <div class="calendar-background">
                        <div class="vector-wrapper">
                          <img
                            class="vector-icon7"
                            loading="lazy"
                            alt=""
                            src="./public/vector.svg"
                          />
                        </div>
                        <div class="feb-2024">Feb 2024</div>
                        <div class="vector-container">
                          <img
                            class="vector-icon8"
                            loading="lazy"
                            alt=""
                            src="./public/vector-11.svg"
                          />
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
                <div class="assignmentind">
                  <div class="cellular-connection-wrapper4">
                    <img
                      class="cellular-connection-icon6"
                      loading="lazy"
                      alt=""
                      src="./public/cellular-connection.svg"
                    />
                  </div>
                  <img
                    class="wifi-icon6"
                    loading="lazy"
                    alt=""
                    src="./public/wifi.svg"
                  />

                  <div class="battery6">
                    <div class="border6"></div>
                    <img
                      class="cap-icon6"
                      loading="lazy"
                      alt=""
                      src="./public/cap.svg"
                    />

                    <div class="capacity6"></div>
                  </div>
                </div>
              </div>
            </div>
          </header>
          <div class="calendar-wrapper">
            <div class="calendar">
              <div class="day-labels-parent">
                <div class="day-labels"></div>
                <div class="sun-5">
                  <p class="sun">Sun</p>
                  <p class="p">5</p>
                </div>
              </div>
              <div class="calendar-inner">
                <div class="rectangle-parent21">
                  <div class="frame-child30"></div>
                  <div class="mon-6">
                    <p class="mon">Mon</p>
                    <p class="p1">6</p>
                  </div>
                </div>
              </div>
              <div class="rectangle-parent22">
                <div class="frame-child31"></div>
                <div class="tue-7-wrapper">
                  <div class="tue-7">
                    <p class="tue">Tue</p>
                    <p class="p2">7</p>
                  </div>
                </div>
                <img class="assignment-ind-icon" loading="lazy" alt="" />
              </div>
              <div class="rectangle-parent23">
                <div class="frame-child32"></div>
                <div class="wed-8">
                  <p class="wed">Wed</p>
                  <p class="p3">8</p>
                </div>
              </div>
              <div class="rectangle-parent24">
                <div class="frame-child33"></div>
                <div class="thu-9">
                  <p class="thu">Thu</p>
                  <p class="p4">9</p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
      <div class="rectangle6"></div>
      <section class="frame-parent23">
        <div class="am-wrapper">
          <div class="am">06:00 AM</div>
        </div>
        <div class="line-group">
          <div class="frame-child34"></div>
          <div class="frame-parent24">
            <div class="frame-parent25">
              <div class="time-separator-wrapper">
                <div class="time-separator">
                  <div class="am-parent">
                    <div class="am1">07:00 AM</div>
                    <div class="am2">08:00 AM</div>
                  </div>
                  <div class="a-mlabel-wrapper">
                    <div class="a-mlabel">
                      <div class="a-mlabel-child"></div>
                      <div class="ab-workout-730am">Ab Workout, 7:30am</div>
                    </div>
                  </div>
                </div>
              </div>
              <div class="frame-child35"></div>
            </div>
            <div class="frame-wrapper10">
              <div class="frame-parent26">
                <div class="circleicon-parent">
                  <div class="circleicon">
                    <div class="circleicon-child"></div>
                  </div>
                  <div class="lowerworkoutlabel">
                    <div class="am3">09:00 AM</div>
                    <div class="am-container">
                      <div class="am4">10:00 AM</div>
                    </div>
                  </div>
                </div>
                <div class="upperandlowerworkouts">
                  <div class="upperandlowerworkouts-child"></div>
                  <div class="upperbody-workout-9am">
                    Upperbody Workout, 9am
                  </div>
                </div>
              </div>
            </div>
          </div>
          <div class="frame-child36"></div>
        </div>
        <div class="am-frame">
          <div class="am5">11:00 AM</div>
        </div>
        <div class="frame-child37"></div>
        <div class="frame-parent27">
          <div class="frame-parent28">
            <input class="frame-child38" placeholder="12:00 AM" type="text" />

            <div class="frame-child39"></div>
          </div>
          <div class="frame-parent29">
            <div class="am-wrapper1">
              <div class="am6">01:00 AM</div>
            </div>
            <div class="line-parent1">
              <div class="frame-child40"></div>
              <div class="frame-wrapper11">
                <div class="frame-parent30">
                  <div class="am-wrapper2">
                    <div class="am7">02:00 AM</div>
                  </div>
                  <div class="rectangle-parent25">
                    <div class="frame-child41"></div>
                    <div class="lowerbody-workout-3pm">
                      Lowerbody Workout, 3pm
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
          <div class="frame-child42"></div>
          <div class="frame-wrapper12">
            <div class="frame-parent31">
              <div class="frame-wrapper13">
                <div class="frame-parent32">
                  <div class="am-wrapper3">
                    <div class="am8">03:00 AM</div>
                  </div>
                  <div class="am9">04:00 AM</div>
                </div>
              </div>
              <div class="wrapper-group-6-parent">
                <div class="wrapper-group-6">
                  <img
                    class="wrapper-group-6-child"
                    loading="lazy"
                    alt=""
                    src="./public/group-6.svg"
                  />
                </div>
                <h1 class="h1">+</h1>
              </div>
            </div>
          </div>
          <div class="frame-child43"></div>
        </div>
        <div class="am-wrapper4">
          <div class="am10">05:00 AM</div>
        </div>
        <div class="frame-child44"></div>
        <footer class="wrapper-group-1-parent">
          <div class="wrapper-group-11">
            <img
              class="wrapper-group-1-item"
              loading="lazy"
              alt=""
              src="./public/group-12.svg"
            />
          </div>
          <button class="rectangle-parent26">
            <div class="frame-child45"></div>
            <img class="frame-child46" alt="" src="./public/group-5.svg" />
          </button>
        </footer>
      </section>
    </div>
  </body>
</html>
